import React from 'react';
import ReactDOM from 'react-dom';
import {ApolloProvider, ApolloClient} from '@apollo/client';

import './index.css';
import App from './components/App';

ReactDOM.render(
  <ApolloProvider>
    <App />
  </ApolloProvider>,
  document.getElementById('root')
);
